import styled from 'styled-components';

const Wrapper = styled.nav`
  
  .top-header-center{
    max-width: var(--max-width-header); 
    p{
      color: #fff;
      display: flex;
      align-items: center;
    }
  }

  .top-header{
    height: 4.8rem;
    background: #000;
  }
`;

export default Wrapper;
